import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav } from 'react-bootstrap';
import Home from './components/Home';
import LatestMovies from './components/LatestMovies';
import UpcomingMovies from './components/UpcomingMovies';
import NearbyEvents from './components/NearbyEvents';

function App() {
  return (
    <Router>
      <>
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="#">Navbar</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mx-auto">
              <Nav.Link as={Link} to="/">Home</Nav.Link>
              <Nav.Link as={Link} to="/latest-movies">Latest Movies</Nav.Link>
              <Nav.Link as={Link} to="/upcoming-movies">Upcoming Movies</Nav.Link>
              <Nav.Link as={Link} to="/nearby-events">Nearby Events</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/latest-movies" element={<LatestMovies />} />
          <Route path="/upcoming-movies" element={<UpcomingMovies />} />
          <Route path="/nearby-events" element={<NearbyEvents />} />
        </Routes>
      </>
    </Router>
  );
}

export default App;
